var sounds = [];
sounds['c'] = new Audio("data:audio/mpeg;base64,");
sounds['ĉ'] = new Audio("data:audio/mpeg;base64,");
sounds['ŝ'] = new Audio("data:audio/mpeg;base64,");
sounds['ĝ'] = new Audio("data:audio/mpeg;base64,");
sounds['ĵ'] = new Audio("data:audio/mpeg;base64,");
sounds['ŭ'] = new Audio("data:audio/mpeg;base64,");
sounds['j'] = new Audio("data:audio/mpeg;base64,");
sounds['ĥ'] = new Audio("data:audio/mpeg;base64,");
gratulon = new Audio("data:audio/mpeg;base64,");